    ObjectHelper.requireNonNull(mapper, "mapper is null");
    ObjectHelper.verifyPositive(prefetch, "prefetch");
    if (this instanceof ScalarSupplier) {
        @SuppressWarnings("unchecked")
        T v = ((ScalarSupplier<T>)this).get();
        if (v == null) {
